import React, { Component } from 'react';
import { withRouter } from 'react-router-dom'
import ProtoShell from './Elements/Shell';
import ProtoNav from './Elements/SideNav';
import ProtoTableView from './Elements/TableView';
import ProtoHeader from './Elements/Breadcrumb';

import "./Proto1.scss";
import Switch from '@react/react-spectrum/Switch/js/Switch';


class Proto1 extends Component {

    render() {
        return (
            <div id="proto1">
                <ProtoShell></ProtoShell>
                <div className="Container">
                    <div className="Container-body">
                        <div className="Container-content">
                            <h1>Proto1</h1>
                            <ProtoHeader></ProtoHeader>
                            <ProtoTableView></ProtoTableView>
                        </div>
                        <nav className="Container-nav"><ProtoNav></ProtoNav></nav>
                        <aside className="Container-rRail">adsadsadsadsadsadsadsadsadsadsadsadsadsadsadsadsads</aside>
                    </div>
                </div>
            </div>
        )
    }

    constructor() {
        super();
    }

    componentDidMount() {
        //kill all functionality of the page except where you need it.
        setTimeout(() => {

            //Clears all event listeners
            let getTheNode = document.getElementById('proto1');
            let aNewNode= getTheNode.cloneNode(true);
            getTheNode.parentNode.replaceChild(aNewNode, getTheNode);

            //Clears all link functionality and applies specific functionality to links
            let getAllLinks = document.getElementsByTagName('a');
            Array.from(getAllLinks).forEach(
                (el) => {
                    switch(el.id){
                        case "":
                            (el)=>{}
                        break;
                        case "":
                            (el)=>{}
                        break;
                        default:
                        (el)=>{
                            el.onclick = ()=>{return false} 
                        };

                    }
                }
            )

        },1)
        // end kill all functionality
    }
}
export default Proto1;
